const styles = theme => ({
    root: {
        height: '100%',
        width: "100%",
        display: 'flex',
        flexDirection: "column",
        alignItems: 'center'
    },
    table: {
        height: 500,
        width: 300,
        backgroundColor: 'red',
        padding: 20
    },
    item: {
        fontSize: 22,
        fontWeight: 500
    }
  });
  export default styles;
